qname_to_atom(Q) ->
   L = get_qname_local_name(Q),
   P = get_qname_prefix(Q),
   list_to_atom(lists:concat([P,":",L])).

xqAtomicValue(Type,Value) ->
   {xqAtomicValue, Type,Value}.

