qname(func, {qname,default,_Px,Ln}) ->
   {qname,xqerl_context:get_default_function_namespace(),"",Ln};
qname(func, {qname,Ns,Px,Ln}) ->
   {qname,Ns,Px,Ln};

qname(pi, Ln) ->
   Str = string:trim(Ln),
   case xqerl_lib:is_xsncname_start_char(hd(Str)) of
      true ->
         lists:foreach(fun($:) -> xqerl_error:error('XPTY0004');
                          (C) ->
                           case xqerl_lib:is_xsname_char(C) of
                              false ->
                                 ?dbg("C",C),
                                 xqerl_error:error('XPTY0004');
                              _ -> ok
                           end
                        end, Str);
      _ ->
         xqerl_error:error('XPTY0004')
   end,
   LC = string:lowercase(Str),
   if LC == "xml" ->
         xqerl_error:error('XPST0003');
      true ->
         {qname,'no-namespace',[],Str}
   end;

