get_qname_local_name({qname,_,_,Nm}) ->
  Nm.
get_qname_prefix({qname,_,Px,_}) ->
  Px.

next_id() ->
   case erlang:get(var_id) of
      undefined ->
         erlang:put(var_id, 2),
         1;
      Id ->
         erlang:put(var_id, Id + 1),
         Id
   end.

next_node_id() ->
   case erlang:get(node_id) of
      undefined ->
         erlang:put(node_id, 1),
         0;
      Id ->
         erlang:put(node_id, Id + 1),
         Id
   end.

at_value([]) ->
   [];
at_value([#xqAtomicValue{value = At}]) ->
   At;
at_value(A) when is_list(A) ->
   try
      lists:flatmap( fun(#xqAtomicValue{value = V}) ->
                            V;
                        ({expr,E}) ->
                            at_value(E);
                        ({entity_ref,E}) ->
                            E;
                        ({char_ref,E}) ->
                            E
                     end, A)
   catch _:E ->
      ?dbg("XQST0022",E),
      ?dbg("XQST0022",A),
      xqerl_error:error('XQST0022')
   end;
at_value(#xqAtomicValue{value = V}) ->
   V;
at_value({expr,A}) ->
   at_value(A);
at_value(A) ->
   ?dbg("XQST0022",A),
   xqerl_error:error('XQST0022').

ns_value([]) ->
   [];
ns_value([#xqAtomicValue{} = At]) ->
   %?dbg("1705",At),
   xqerl_lib:pct_encode3(string:trim(xqerl_lib:shrink_spaces(element(3,At))));
ns_value([{expr,A}]) ->
   ?dbg("XQST0022",A),
   xqerl_error:error('XQST0022');
ns_value(A) when is_list(A) ->
   %?dbg("1708",A),
   try
      L = lists:flatmap( fun(#xqAtomicValue{value = V}) ->
                            V;
                        ({expr,_E}) ->
                            xqerl_error:error('XQST0022');
                        ({entity_ref,E}) ->
                            E;
                        ({char_ref,E}) ->
                            E
                     end, A),
      xqerl_lib:pct_encode3(string:trim(xqerl_lib:shrink_spaces(L)))
   catch _:_ ->
      ?dbg("XQST0022",A),
      xqerl_error:error('XQST0022')
   end;
ns_value(A) ->
   ?dbg("XQST0022",A),
   xqerl_error:error('XQST0022').


as_list(L) ->
   if is_list(L) -> L;
      true -> [L]
   end.

dir_att(QName, Value) ->
   if QName#qname.prefix == "xmlns"  ->
         %xqerl_context:add_statically_known_namespace(ns_value(Value), QName#qname.local_name),
         #xqNamespaceNode{name = #qname{namespace = ns_value(Value), prefix = QName#qname.local_name, local_name = []}};
      QName#qname.local_name == "xmlns" andalso QName#qname.prefix == default ->
         case at_value(Value) of 
            "" -> 
               %xqerl_context:add_statically_known_namespace('no-namespace', []),
               #xqNamespaceNode{name = #qname{namespace = 'no-namespace', prefix = [], local_name = []}};
            _ -> 
               %xqerl_context:add_statically_known_namespace(ns_value(Value), []),
               #xqNamespaceNode{name = #qname{namespace = ns_value(Value), prefix = [], local_name = []}} 
         end;
      true ->
         #xqAttributeNode{name = qname(other,QName), 
                          expr = case Value of
                                    [] -> [#xqAtomicValue{type = 'xs:string', value = ""}];
                                    undefined -> [#xqAtomicValue{type = 'xs:string', value = ""}];
                                    _ -> normalize_att_content(Value)
                                    end}
   end.
  
normalize_att_content(Content) ->
   lists:map(
      fun(#xqAtomicValue{value = Str} = A) ->
            A#xqAtomicValue{value = normalize_whitespace(Str)};
         (O) ->
            O
      end, Content).

normalize_whitespace([H|T]) when H == 32;
                                 H == 13;
                                 H == 10;
                                 H == 9 ->
   [32|normalize_whitespace(T)];
normalize_whitespace([H|T]) ->
   [H|normalize_whitespace(T)];
normalize_whitespace([]) ->
   [].

is_partial_impl(PostFixes) ->
   lists:any(fun({arguments,Args}) ->
                  lists:any(fun({'?',_}) -> true;
                               (_) -> false
                            end, Args);
                (_) -> false
             end,PostFixes).


